import styled from "styled-components";
import colors from '../../theme/main/colors';

const OfficeDetail = styled("div")`  
    width:400px;
`;


const HeaderTitle = styled('h3')`
font-weight: 600;
font-size: 20px;
line-height: 27px;
color:${colors.primary};
margin: 5px 0px;
`;

const HeaderSubTitle = styled('h6')`
position: static;
width: 257px;
height: 25px;
left: calc(50% - 257px/2);
top: calc(50% - 25px/2 + 27px);

font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 18px;
line-height: 25px;
text-align: center;


color: #444444;
`;
const ContentTitle = styled('h5')`
font-size: 14px;
line-height: 19px;

color: #444444;
margin: 5px 0px;
`;


const ContentDetailText = styled('p')`
font-size: 16px;
line-height: 22px;

color: #444444;
`;

const Info = () => {
    return(
        <>
        <HeaderTitle>
        Let's talk...
        </HeaderTitle>
        </>
    );
}

export default Info;
